import React from "react";

function Relatedgame() {
  return (
    <div className="RlMain">
      <h1 className="RlH1">
        Lorem Ipsum is simply dummy text of the <br /> printing and typesetting
        industry.
      </h1>
      <div className="littleinfo">
        <h2 >Lorem Ipsum</h2>
        <p>Lorem Ipsum is simply dummy text of the printing and typesetting <br /> industry. Lorem Ipsum has been the industry's standard dummy text <br /> ever since the 1500s,</p>
      </div>

      <h6>ABC</h6>
    </div>
  );
}

export default Relatedgame;
